INSERT INTO `v1_35883b8ff1d1ca04b65ddcfa61fd518b16fdd0ce9a183390a26d44958d6578d7` VALUES (513043, 0.5, 1, 5, 0, "ふふ。ボクを呼んでくれて正解だよ。\nこの新年の晴れやかな日にこそ\nボクの輝く美貌が必要だからね！", 0, 11, 0, 100811, 513);
